import React from "react";
import "./maker.scss";

const Maker = () => {
  return (
    <div class="container">

      <div class="jobs" id="jobs">
        <div class="jobs__item">
          <div class="jobs__column jobs__column--left">
            <img src="./asset/client.png"alt=""class="jobs__img"/>
            <div class="jobs__info">
              <span class="jobs__number">JOB #1</span>
              <span class="jobs__title">VITTORIA SALIM</span>


              <p class="jobs__details-item">Type of clothing  : Dress </p><br></br>
              <p class="jobs__details-item">Quotation         : 1 quotes</p><br></br>
              <p class="jobs__details-item">Lorem ipsum dolor sit amet, consectetu..</p>

            </div>
          </div>
          {/* <div class="jobs__column jobs__column--right">
            ksdmckkc
          </div> */}
        </div>
      </div>
    </div>
  );
};

export default Maker;
